import "./App.css";
import HomePage from "./components/ReflectionArea";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/login" component={Login} />
        <Route path="/template" component={ReflectionArea} />
      </Switch>
    </Router>
  );
}

export default App;
